import React, { useEffect, useState } from 'react'
import NavScrollExample from '../components/common/Navbar'
import Axiosinstance from '../config/Axiosinstances';
import Cards from '../components/common/Cards';
import { useNavigate } from 'react-router-dom';

function Home() {
const [courtData, setCourtData] = useState([])
const navigate= useNavigate()
useEffect(() => {
 getAllcourtsData()
}, []);
const getAllcourtsData=()=>{
  Axiosinstance.get('/users/getAllcourtsData').then((response)=>{
    setCourtData(response.data)

  })
  .catch(err=>{
    if (err.message==='unauthorized user')
    { localStorage.clear()
       navigate('/')
 }
  })
}





  return (
  <>
  <NavScrollExample/>
 
  <div className='container'>
    <div className="p-2 row gap-3">
{  courtData.map((court)=><Cards court={court} />)  }
       </div>
  </div>
  
  </>
  )
}

export default Home
